import React from 'react';

const ResultsSection = ({ results, onDownload }) => {
  if (!results) {
    return null;
  }

  const handleDownload = () => {
    // Create CSV content
    const csvContent = 'data:text/csv;charset=utf-8,' + 
      'Station,Latitude,Longitude,Precipitation\\n' +
      results.stations.map(station => 
        `${station.name},${station.lat},${station.lng},${station.precipitation}`
      ).join('\\n');

    const encodedUri = encodeURI(csvContent);
    const link = document.createElement('a');
    link.setAttribute('href', encodedUri);
    link.setAttribute('download', 'precipitation_results.csv');
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);
  };

  return (
    <div className="bg-white p-4 rounded-lg shadow">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-bold">Results</h2>
        <button
          onClick={handleDownload}
          className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600"
        >
          Download Results
        </button>
      </div>

      <div className="space-y-4">
        {results.calculatedValue && (
          <div>
            <h3 className="font-semibold">Calculated Missing Value:</h3>
            <p className="text-lg">{results.calculatedValue.toFixed(2)} mm</p>
          </div>
        )}

        {results.stations && (
          <div>
            <h3 className="font-semibold mb-2">Station Data:</h3>
            <div className="overflow-x-auto">
              <table className="min-w-full table-auto">
                <thead>
                  <tr className="bg-gray-100">
                    <th className="px-4 py-2">Station</th>
                    <th className="px-4 py-2">Latitude</th>
                    <th className="px-4 py-2">Longitude</th>
                    <th className="px-4 py-2">Precipitation (mm)</th>
                  </tr>
                </thead>
                <tbody>
                  {results.stations.map((station, index) => (
                    <tr key={index} className="border-b">
                      <td className="px-4 py-2">{station.name || `Station ${index + 1}`}</td>
                      <td className="px-4 py-2">{station.lat}</td>
                      <td className="px-4 py-2">{station.lng}</td>
                      <td className="px-4 py-2">{station.precipitation}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsSection;
